import fetch from "node-fetch";
const posts = () => (
  <>
    <h2>GetStaticProps</h2>
    <br />
    <table>
      <thead>
        <tr>
          <th>Id</th>
          <th>User Id</th>
          <th>Title</th>
        </tr>
      </thead>
      <tbody>
        {posts.map(
          { id, userId, title }(
            <tr key={id}>
              <td>{id}</td>
              <td>{userId}</td>
              <td>{title}</td>
            </tr>
          )
        )}
      </tbody>
    </table>
  </>
);

export async function getStaticProps() {
  const res = await fetch("https://jsonplaceholder.typicode.com/posts");
  const posts = await res.json();
  return {
    props: {
      posts,
    },
  };
}
export default posts;
